function Messages() {
  return(
    <ul>
      <li>Messg1</li>
      <li>Messg2</li>
    </ul>
  );
}

function MessageBar() {
  return(
    <form>
      <input type = "text" placeholder = "Enter text here..."/>
    </form>
  );
}

function RoomName({name}){
  return(
    <p>{name}</p>
  );
}

function RoomsList({ rooms }){
  const rows = [];

  rooms.forEach((room) => {
    rows.push(
      <RoomName name = {room.name} />
    );
  });

  return(
    <ul>
      {rows}
    </ul>
  );
}

const ROOMS = [
  {name: "fun"},
  {name: "yoga"}
];

function CurrentRoom() {
  return (
    <div id = "room">
      <h1>Welcome to Chat Room</h1>
      <Messages />
      <MessageBar />

    </div>
  );
}

export default function App() {
  return <CurrentRoom />;
}
